import React from "react";

const Product = props => {
  console.log(props.prod);
  return (
    <article class="product">
      <div className="product">
        <li>
          {props.prod.title}
          <img className="imgsP" src={props.prod.img} alt="image" />
          <button className="bag-btn">Add product</button>
        </li>
      </div>
    </article>
  );
};

export default Product;
